import React from "react";
import { Outlet } from "react-router-dom";


export default function Dashboard() {

    //create a logout function
    const logout = () => {
        localStorage.removeItem("token");
        window.location.href = "/";
    };

    return (
        <div>
            <h1>Dashboard</h1>
            <Outlet />
        </div>
    );
}
